import React from 'react';
import IntlMessages from '../../../../util/IntlMessages';
export default [
  {
    'title': <IntlMessages id="extraPages.all"/>,
  },
  {
    'title': <IntlMessages id="autocomplete.emploidutemps.none"/>,
  },
  {
    'title': <IntlMessages id="filter.read"/>,
  },
  {
    'title': <IntlMessages id="filter.unread"/>,
  },
  {
    'title': <IntlMessages id="mail.favorites"/>,
  },
  {
    'title': <IntlMessages id="mail.important"/>,
  },
  {
    'title': <IntlMessages id="filter.unimportant"/>,
  }
];
